(71788, x, x, '|TInterface\\Icons\\Ability_Siege_Engineer_Detonate.blp:20|tA Crawler Mine has targeted you!', 42, 0, 100, 0, 0, 0, 0, 'Crawler Mine to Player'),
(72964, x, x, 'You''re Screwed!', 14, 0, 100, 0, 0, 0, 0, 'Goro''dan to 0'),
(71161, x, x, 'Look brothers, the Wakener is here!', 14, 0, 100, 0, 0, 38657, 0, 'Kil''ruk the Wind-Reaver to Player'),
(71161, x, x, 'I will carry you one last time Wakener... to your doom!', 14, 0, 100, 0, 0, 38654, 0, 'Kil''ruk the Wind-Reaver to The Klaxxi Paragons'),
(71161, x, x, 'Well fought Wakener.  We will meet again...', 14, 0, 100, 0, 0, 38655, 0, 'Kil''ruk the Wind-Reaver to 0'),
(71160, x, x, 'How illogical, did they not hear your warning Kil''ruk?', 14, 0, 100, 0, 0, 38621, 0, 'Iyyokuk the Lucid to Player'),
(71160, x, x, 'Chaos is order unrecognized by a lesser mind!', 14, 0, 100, 0, 0, 38618, 0, 'Iyyokuk the Lucid to The Klaxxi Paragons'),
(71160, x, x, 'How about a game?', 14, 0, 100, 0, 0, 38623, 0, 'Iyyokuk the Lucid to 0'),
(71160, x, x, 'Iyyokuk begins choosing criteria from $n!', 16, 0, 100, 0, 0, 0, 0, 'Iyyokuk the Lucid to Player'),
(71160, x, x, 'Iyyokuk selects: Four!', 41, 0, 100, 0, 0, 0, 0, 'Iyyokuk the Lucid to Iyyokuk the Lucid'),
(71160, x, x, 'Iyyokuk selects: |cFFFF0000Red|r!', 41, 0, 100, 0, 0, 0, 0, 'Iyyokuk the Lucid to Iyyokuk the Lucid'),
(71160, x, x, 'Iyyokuk selects: One!', 41, 0, 100, 0, 0, 0, 0, 'Iyyokuk the Lucid to Iyyokuk the Lucid'),
(71160, x, x, 'I see many threes repeating...', 14, 0, 100, 0, 0, 38625, 0, 'Iyyokuk the Lucid to 0'),
(71160, x, x, 'Iyyokuk begins choosing criteria from $n!', 16, 0, 100, 0, 0, 38624, 0, 'Iyyokuk the Lucid to Player'),
(71160, x, x, 'Iyyokuk selects: |cFFFF0000Red|r!', 41, 0, 100, 0, 0, 38624, 0, 'Iyyokuk the Lucid to Iyyokuk the Lucid'),
(71160, x, x, 'An interesting commonality, now to exploit it!', 14, 0, 100, 0, 0, 38624, 0, 'Iyyokuk the Lucid to 0'),
(71160, x, x, 'My calculations, incorrect? Perhaps another 800 years...', 14, 0, 100, 0, 0, 38619, 0, 'Iyyokuk the Lucid to 0'),
(71158, x, x, 'They made it this far? I told you the others needed some micro-sonic genetic alterations.', 14, 0, 100, 0, 0, 38916, 0, 'Rik''kal the Dissector to Player'),
(71158, x, x, 'Yes... new test subjects!', 14, 0, 100, 0, 0, 38913, 0, 'Rik''kal the Dissector to The Klaxxi Paragons'),
(71158, x, x, 'Perhaps I could have used... some enhancements... of my own...', 14, 0, 100, 0, 0, 38914, 0, 'Rik''kal the Dissector to 0'),
(71158, x, x, 'Curses!  More data lost to an untimely death.', 14, 0, 100, 0, 0, 38917, 0, 'Rik''kal the Dissector to Voodoo Gnome'),
(71158, x, x, 'Curses!  More data lost to an untimely death.', 14, 0, 100, 0, 0, 38679, 0, 'Rik''kal the Dissector to Voodoo Gnome'),
(71158, x, x, 'Curses!  More data lost to an untimely death.', 14, 0, 100, 0, 0, 38917, 0, 'Rik''kal the Dissector to Player'),
(71158, x, x, 'Natural evolution takes far too long. Here, let me help you along...', 14, 0, 100, 0, 0, 38919, 0, 'Rik''kal the Dissector to 0'),
(71154, x, x, 'We will slay you all as easily as we slew the Pandaren of old.', 14, 0, 100, 0, 0, 38637, 0, 'Ka''roz the Locust to Player'),
(71154, x, x, 'You move too slowly, how does your kind catch any prey?', 14, 0, 100, 0, 0, 38634, 0, 'Ka''roz the Locust to The Klaxxi Paragons'),
(71154, x, x, 'Zooooooooom!', 14, 0, 100, 0, 0, 38671, 0, 'Ka''roz the Locust to 0'),
(71154, x, x, 'See Kil''ruk? Speed is king!', 14, 0, 100, 0, 0, 38638, 0, 'Ka''roz the Locust to Player'),
(71154, x, x, 'Zooooooooom!', 14, 0, 100, 0, 0, 38641, 0, 'Ka''roz the Locust to 0'),
(71154, x, x, 'Much too slow.', 14, 0, 100, 0, 0, 0, 0, 'Ka''roz the Locust to The Klaxxi Paragons'),
(71154, x, x, 'Curse this chitinous shell, I was not fast enough!', 14, 0, 100, 0, 0, 38635, 0, 'Ka''roz the Locust to 0'),
(73716, x, x, 'Ah, more of Vol''jin''s revolutionaries. You''ve made it.', 12, 0, 100, 0, 0, 0, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'Have you found Thrall? I am badly hurt, he insisted on going ahead alone.', 12, 0, 100, 0, 0, 0, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'Tell me, how goes the battle up above? What of Nazgrim? Speak to me!', 12, 0, 100, 0, 0, 0, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'Ah, Nazgrim. A great leader and a fine warrior. He valued his oath to the Warchief more than his life.', 12, 0, 100, 0, 0, 38916, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'I tried to tell him... to tell him that Hellscream betrayed us, cast aside a Warchief''s responsibility to his own people.  But Nazgrim... too loyal... too proud.', 12, 0, 100, 0, 0, 38707, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'Damn Hellscream.  His ambition tore our Horde apart.', 12, 0, 100, 274, 0, 38670, 0, 'High Overlord Saurfang to Player'),
(73716, x, x, 'Go on, find Thrall.  Finish this.  I will live.', 12, 0, 100, 1, 0, 0, 0, 'High Overlord Saurfang to Player'),
(71591, x, x, 'An Automated Shredder draws near!', 41, 0, 100, 0, 0, 0, 0, 'Automated Shredder to 0'),
(71157, x, x, 'We Mantid serve a power far greater than they or their gods.', 14, 0, 100, 0, 0, 38707, 0, 'Xaril the Poisoned Mind to Player'),
(71157, x, x, 'Have you come to try my new concoctions, Wakener?  I assure you these are nothing like you''ve tasted before.', 14, 0, 100, 0, 0, 38704, 0, 'Xaril the Poisoned Mind to The Klaxxi Paragons'),
(71157, x, x, 'So many wonderful varieties, which concoction shall I give you?', 14, 0, 100, 0, 0, 38709, 0, 'Xaril the Poisoned Mind to 0'),
(71157, x, x, 'Xaril hurls red catalyst around the room!', 41, 0, 100, 0, 0, 0, 0, 'Xaril the Poisoned Mind to Xaril the Poisoned Mind'),
(71157, x, x, 'Xaril hurls yellow catalyst around the room!', 41, 0, 100, 0, 0, 0, 0, 'Xaril the Poisoned Mind to Xaril the Poisoned Mind'),
(71157, x, x, 'Xaril hurls red catalyst around the room!', 41, 0, 100, 0, 0, 38709, 0, 'Xaril the Poisoned Mind to Xaril the Poisoned Mind'),
(71157, x, x, 'My alchemy is supreme!', 14, 0, 100, 0, 0, 38708, 0, 'Xaril the Poisoned Mind to Player'),
(71157, x, x, 'I never discovered... how to put a stopper... in death...', 14, 0, 100, 0, 0, 38705, 0, 'Xaril the Poisoned Mind to 0'),
(72694, x, x, 'Goro''dan! You''re on deck!', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Player'),
(72694, x, x, 'Alright, Shanna. You''re up.', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to Player'),
(72694, x, x, 'Looks like I''m in the market for a new assistant.', 14, 0, 100, 0, 0, 0, 0, 'Siegecrafter Blackfuse to 0'),
(72694, x, x, 'Let''s settle this.', 14, 0, 100, 0, 0, 38446, 0, 'Siegecrafter Blackfuse to Siegecrafter Blackfuse'),
